function ver_comp($first,$second)
  {
  $first=explode('.',$first);
  $second=explode('.',$second);
  for($i=0,$tot=max(count($first),count($second));$i<$tot;$i++)
    {
    if(!isSet($first[$i])) return -1;
    if(!isSet($second[$i])) return 1;
    if($first[$i]==$second[$i]) continue;
    else if($first[$i]>$second[$i]) return 1;
    else return -1;
    }
  return 0;
  }
